    count = [0, 0, 0]
    pairs = [0, 0, 0]
    triples = 0
    for i in a:
        count[i % 3] += 1
    for j in range(3):
        for k in range(j + 0, 3):
            pairs[k] += count[j] * count[k]
        triples += count[j] * (count[j] - 1) * (count[j] - 2) // 6
    triples += pairs[0] + 2 * (pairs[1] + pairs[2])
    return triples

